scriptlet.script:
var re = /^Valid ([0-9]) key\(s\) - ([^\s]+)$/;
var result = [];
if( keyValidation !== undefined && keyValidation.trim() !== "" && (result = re.exec(keyValidation)) !== null ) {
    var count = parseInt(result[1]);
    var filename = result[2];
    scriptletContext.put("count",count);
    scriptletContext.put("filename",filename);
    scriptletResponse="Yes";
}
else {
    scriptletResponse="No";
}

try {
	var URLEncoder = Java.type("java.net.URLEncoder");
	var encoded = URLEncoder.encode(content, "UTF-8");
	var sql = "update ENA_ACTIVE_LABS set KEYS = '" + encoded + "' where REQUEST = '" + requestId + "'";
	scriptletResult = sql;
	scriptletContext.put("SQL",sql);
	scriptletResponse = "success";
}
catch(Error) {
	scriptletResponse = "failure";
	scriptletContext.put("FailureMessage",Error);
}

try {
	var sql = "update ENA_ACTIVE_LABS set SERVER_LIST = '" + serverList + "' where REQUEST = '" + requestId + "'";
	scriptletResult = sql;
	scriptletContext.put("SQL",sql);
	scriptletResponse = "success";
}
catch(Error) {
	scriptletResponse = "failure";
	scriptletContext.put("FailureMessage",Error);
}

try {
	var sl = JSON.parse(serverList);
	var srvs = Object.keys(sl);
	srvs.forEach(function(s) {
		sl[s].publicKey = keyValidation;
	});
	scriptletContext.putGlobal("serverList",JSON.stringify(sl));	
	scriptletResponse="success";
}
catch(Error) {
	scriptletResponse = "failure";
	scriptletContext.put("FailureMessage",Error);
}
